import axios from "axios";
const KEY = "AIzaSyD6wvVhpJkyP5c3-K2NrHp7o48lFLrZlA4";

export default axios.create({
  baseURL: "https://www.googleapis.com/youtube/v3",
  params: {
    part: "snippet",
    maxResults: 5,
    key: KEY,
  },
});
